import React from 'react'

const ProjectItem = (props) => {
    const {item} = props;

    return (
        <div>
            {item.url && <p>{item.url}</p>}
            <p>{item.title}</p>
            <div>
                {item.github && <button>{item.github}</button>}
                {item.livedemo && <button>{item.livedemo}</button>}
            </div>
            <p>{item.description}</p>
        </div>
    )
}

export default ProjectItem
